// Find the largest product of 5 consecutive digits in the following very long number.
number = "";
var productnum = function productnum(num) {
  num = num.split('');
  var max = -Infinity;

  for(var i = 4; i < num.length; i++){
     if(num[i - 4] * num[i - 3] * num[i - 2] * num[i - 1] *                num[i] > max){
          max = num[i - 4] * num[i - 3] * num[i - 2] * num[i -                 1] *num[i];
     }
  }
  return max;
};

a = productnum(number);
console.log(a);
